import { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import { API_ENDPOINTS } from "../config/api";

// Color constants
const COLORS = {
  magenta: '#AA056C',
  yellowGreen: '#C4CB07',
  lightPink: '#F46690',
  gray: '#64748B'
};

function Header() {
    const accessToken = sessionStorage.getItem('access_token');
    const isAdmin = sessionStorage.getItem('is_admin') === 'true';
    const navigate = useNavigate();
    const [statusMessage, setStatusMessage] = useState({ show: false, text: '', type: 'info' });

    const showStatusMessage = (text, type = 'info') => {
        setStatusMessage({ show: true, text, type });
        setTimeout(() => setStatusMessage({ show: false, text: '', type: 'info' }), 5000);
    };

    const handleLogout = async () => {
        const refreshToken = sessionStorage.getItem('refresh_token');
        const accessToken = sessionStorage.getItem('access_token');
        if (!refreshToken || !accessToken) {
            showStatusMessage("No valid tokens found. Please log in again.", 'error');
            sessionStorage.clear();
            navigate('/login');
            return;
        }
        try {
            const response = await fetch(API_ENDPOINTS.LOGOUT, {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                    'Authorization': `Bearer ${accessToken}`,
                },
                body: JSON.stringify({ refresh: refreshToken }),
            });
            if (response.ok) {
                sessionStorage.clear();
                navigate('/login');
                showStatusMessage("Logout Successful", 'success');
            } else {
                sessionStorage.clear();
                const errorData = await response.json();
                console.error("Logout failed:", response.status, errorData);
                showStatusMessage(`Logout Failed: ${errorData.detail || response.statusText}`, 'error');
            }
        } catch (error) {
            console.error("Error during logout:", error);
            showStatusMessage("Error during logout: " + error.message, 'error');
        }
    };

    return (
        <>
            {/* Status Message */}
            {statusMessage.show && (
                <div className={`fixed top-4 right-4 z-50 p-4 rounded-lg shadow-lg ${
                    statusMessage.type === 'error' ? 'bg-red-100 border-l-4 border-red-500' : 
                    statusMessage.type === 'success' ? 'bg-green-100 border-l-4 border-green-500' : 
                    'bg-blue-100 border-l-4 border-blue-500'
                }`} style={{ fontFamily: 'Calibri, Verdana, sans-serif' }}>
                    <p className={`font-bold ${statusMessage.type === 'error' ? 'text-red-700' : statusMessage.type === 'success' ? 'text-green-700' : 'text-blue-700'}`} style={{ fontSize: '12px' }}>
                        {statusMessage.text}
                    </p>
                </div>
            )}

            <div className="bg-gray-100 rounded-md p-2 text-center" style={{ fontFamily: 'Calibri, Verdana, sans-serif' }}>
                <nav className="font-bold mb-2" style={{ fontSize: '18px', color: COLORS.magenta }}>
                    {accessToken ? (
                        <>
                            <Link to="/cash-drop" className="m-3 p-3 transition hover:underline" style={{ color: COLORS.magenta, fontSize: '12px' }}>Cash Drop</Link>
                            <Link to="/cd-dashboard" className="m-3 p-3 transition hover:underline" style={{ color: COLORS.magenta, fontSize: '12px' }}>Cash Drop Dashboard</Link>
                            {isAdmin && (
                                <Link to="/dashboard" className="m-3 p-3 transition hover:underline" style={{ color: COLORS.magenta, fontSize: '12px' }}>Admin Dashboard</Link>
                            )}
                            {isAdmin && (
                                <Link to="/register" className="m-3 p-3 transition hover:underline" style={{ color: COLORS.magenta, fontSize: '12px' }}>Register</Link>
                            )}
                            {isAdmin && (
                                <Link to="/cd-validation" className="m-3 p-3 transition hover:underline" style={{ color: COLORS.magenta, fontSize: '12px' }}>Cash Drop Validation</Link>
                            )}
                            {isAdmin && (
                                <Link to="/bank-drop" className="m-3 p-3 transition hover:underline" style={{ color: COLORS.magenta, fontSize: '12px' }}>Bank Drop</Link>
                            )}
                            <button onClick={handleLogout} className="m-3 p-3 transition hover:underline" style={{ color: COLORS.magenta, fontSize: '12px' }}>Logout</button>
                        </>
                    ) : (
                        <>
                            <Link to="/login" className="m-3 p-3 transition hover:underline" style={{ color: COLORS.magenta, fontSize: '12px' }}>Login</Link>
                            <Link to="/cash-drop" className="m-3 p-3 transition hover:underline" style={{ color: COLORS.magenta, fontSize: '12px' }}>Cash Drop</Link>
                            <Link to="/cd-dashboard" className="m-3 p-3 transition hover:underline" style={{ color: COLORS.magenta, fontSize: '12px' }}>Cash Drop Dashboard</Link>
                        </>
                    )}
                </nav>
            </div>
        </>
    );
}

export default Header;
